import bpy

############################ Add Pose Bone Properties ############################ 

def add_pbones_properties(self, context):
    
    pbones = bpy.context.object.pose.bones

    def add_bone_props(b_name, rot_mode, lock_loc, lock_rot, lock_w, lock_4d, lock_scale, group, group_check, shape_name, shape_scale, shape_transform, use_custom_size, show_wire, hide, is_in_ik_chain):
        pbones[b_name].rotation_mode = rot_mode 
        pbones[b_name].lock_location[:] = lock_loc
        pbones[b_name].lock_rotation[:] = lock_rot
        pbones[b_name].lock_rotation_w = lock_w
        pbones[b_name].lock_rotations_4d = lock_4d
        pbones[b_name].lock_scale[:] = lock_scale
        if group_check == 'group':
            pbones[b_name].bone_group_index = group 
        pbones[b_name].custom_shape = shape_name
#        pbones[b_name].custom_shape_scale = shape_scale
        pbones[b_name].custom_shape_transform = shape_transform 
#        pbones[b_name].use_custom_shape_bone_size = use_custom_size
        pbones[b_name].bone.show_wire = show_wire
        pbones[b_name].bone.hide = hide 
        pbones[b_name].is_in_ik_chain == is_in_ik_chain  

    def add_ik_props(b_name, ik_max_x, ik_max_y, ik_max_z, ik_min_x, ik_min_y, ik_min_z, ik_stiffness_x, ik_stiffness_y, ik_stiffness_z, ik_stretch, lock_ik_x, lock_ik_y, lock_ik_z, use_ik_limit_x, use_ik_limit_y, use_ik_limit_z):
        pbones[b_name].ik_max_x = ik_max_x 
        pbones[b_name].ik_max_y = ik_max_y 
        pbones[b_name].ik_max_z = ik_max_z 
        pbones[b_name].ik_min_x = ik_min_x 
        pbones[b_name].ik_min_y = ik_min_y 
        pbones[b_name].ik_min_z = ik_min_z
        pbones[b_name].ik_stiffness_x = ik_stiffness_x   
        pbones[b_name].ik_stiffness_y = ik_stiffness_y   
        pbones[b_name].ik_stiffness_z = ik_stiffness_z   
        pbones[b_name].ik_stretch = ik_stretch      
        pbones[b_name].lock_ik_x = lock_ik_x    
        pbones[b_name].lock_ik_y = lock_ik_y    
        pbones[b_name].lock_ik_z = lock_ik_z    
        pbones[b_name].use_ik_limit_x = use_ik_limit_x    
        pbones[b_name].use_ik_limit_y = use_ik_limit_y    
        pbones[b_name].use_ik_limit_z = use_ik_limit_z     


